import datetime

def parse_iso8601(date_str, delimiter='T', timezone=None):
    try:
        if delimiter == 'T':
            date_str = date_str.replace('Z', '+00:00')
            date_obj = datetime.datetime.strptime(date_str, '%Y-%m-%dT%H:%M:%S%z')
        else:
            date_obj = datetime.datetime.strptime(date_str, '%Y-%m-%d %H:%M:%S%z')

        if timezone:
            date_obj = date_obj.astimezone(timezone)

        return str(int(date_obj.timestamp()))
    except ValueError:
        return None
